                <AccordionItem>
                  <AccordionItemHeading>
                    <AccordionItemButton>
                      Is free will real or just an illusion?
                    </AccordionItemButton>
                  </AccordionItemHeading>
                  <AccordionItemPanel>
                    <p>
                      In ad velit in ex nostrud dolore cupidatat consectetur ea
                      in ut nostrud velit in irure cillum tempor laboris sed
                      adipisicing eu esse duis nulla non.
                    </p>
                  </AccordionItemPanel>
                </AccordionItem>
              </Accordion>
            </div>
          </div>
        </div>
      </section>

      <section className="pb-5 text-center d-flex justify-content-center align-items-center ">
        <div className="bg-lightblue boxwidth">
          <i class="far fa-comment"></i>
          <h3>Not seeing your question here?</h3>
          <button className="btn btn-primary btn-lg">Ask us directly?</button>
        </div>
      </section>
    </HomeLayouts>

    <style jsx global>
      {`
        .bg-lightblue {
          background: #eff8fd;
        }

        .boxwidth {
          width: 200px;
        }
        /**
       * ----------------------------------------------
       * Demo styles
       * ----------------------------------------------
       **/
        .accordion {
          border: 1px solid rgba(0, 0, 0, 0.1);
          border-radius: 2px;
        }

        .accordion__item + .accordion__item {
          border-top: 1px solid rgba(0, 0, 0, 0.1);
        }

        .accordion__button {
          background-color: #f4f4f4;
          color: #444;
          cursor: pointer;
          padding: 18px;
          width: 100%;
          text-align: left;
          border: none;
        }

        .accordion__button:hover {
          background-color: #ddd;
        }

        .accordion__button:before {
          display: inline-block;
          content: "";
          height: 10px;
          width: 10px;
          margin-right: 12px;
          border-bottom: 2px solid currentColor;
          border-right: 2px solid currentColor;
          transform: rotate(-45deg);
        }

        .accordion__button[aria-expanded="true"]::before,
        .accordion__button[aria-selected="true"]::before {
          transform: rotate(45deg);
        }

        .accordion__panel {
          padding: 20px;
          animation: fadein 0.35s ease-in;
        }

        /* -------------------------------------------------- */
        /* ---------------- Animation part ------------------ */
        /* -------------------------------------------------- */

        @keyframes fadein {
          0% {
            opacity: 0;
          }

          100% {
            opacity: 1;
          }
        }
      `}
    </style>
  </React.Fragment>
);

export default Faq;
